import React from 'react';
import BaseLayout from './../components/layouts/BaseLayout'


class SuperComponent extends React.Component {

  constructor() {
    super();
    this.someVariable = 'Just someVariable';
  }

  alertName(title){
    alert(title);
  }
  render() {
    return(
      <BaseLayout>
      <h1> I am Blog Page </h1>
      </BaseLayout>
    )
  }
} 

export default Blog;
